#include<bits/stdc++.h>

using namespace std;

int main()
{
    ios::sync_with_stdio(0);
    cin.tie(0);
    int n; cin >> n;
    int a[n + 1];
    for (int i = 0; i <= n; i++) a[i] = 0;
    for (int x = 1; x <= n; x++)
    {
        for (int y = 1; y <= n; y++)
        {
            for (int z = 1; z <= n; z++)
            {
                if (x * x + y * y + z * z + x * y + y * z + x * z > n) break;
                a[x * x + y * y + z * z + x * y + y * z + x * z]++;
            }
        }
    }
    for (int i = 1; i <= n; i++) cout << a[i] << endl;
    return 0;
}
